--create main Database to hold Data on NHL teams
create database NHLDB
-- the Dtabase will have 9 main tables that hold data for the past 20 seasons

create table Games(
GameID int primary key,
SeasonID int,
Date date,
HomeTeamID int,
AwayTeamID int,
VenueID int,
HomeTeamScore int,
AwayTeamScore int,
Overtime bit,
Shootout bit
)

--Stores information about each NHL team.
create table Team(
TeamID int not null primary key identity(1,1),
TeamName nvarchar(50) not null,
Abbreviation nvarchar(10),
City nvarchar(50),
FoundYear int,
HomeArena nvarchar(50),
Conference nvarchar(50)
)
--Add three more columns on the teams table - State or Province,Nickname and club official website
alter table Team
add StateOrProvince nvarchar(50);
alter table Team
add Nickname nvarchar(20);
alter table Team
add Website nvarchar(100);
--Inserts each Teams data into the Team table


--Defines the different playing positions.
create table Position(
PositionID int primary key,
PositionName nvarchar(20),
Abbreviation nvarchar(10)
)
select*
from Position
--insert Playing positions data into the Position table

--Defines the seasons which is a year long
create table Seasons(
SeasonID int primary key,
SeasonYear nvarchar(10),
StartDate date,
EndDate date
)

select *
from Seasons
--insert data on each seasons


create table Venues(
VenueID int primary key,
VenueName nvarchar(50),
City nvarchar(50),
StateorProvince nvarchar(50),
Capacity nvarchar(50),
OpenedYear nvarchar(50),
TeamID int
constraint fkTeamID foreign key (TeamID) references Team(TeamID)
)
alter table Venues
alter column Capacity int
alter table Venues
alter column OpenedYear int



--Define data for Teamstats which includes goalsfor goalsagaints and shots on goals

select *
from TeamStats

create table TeamStats(
TeamStatsID int primary key,
TeamID int,
SeasonID int,
GoalsFor int,
GoalsAgainst int,
ShotsOnGoal int,
constraint fkTeamID2 foreign key (TeamID) references Team(TeamID),
constraint fkSeasonID foreign key (SeasonID) references Seasons(SeasonID)
)
--insert data into TeamStats

drop table Player

create table Player(
PlayerID int primary key,
FirstName nvarchar(50),
LastName nvarchar(50),
DateofBirth date,
Nationality nvarchar(50),
Height int,
Weight int,
TeamID int,
PositionID int,
constraint fkTeamID3 foreign key (TeamID) references Team(TeamID),
constraint fkPositionID foreign key (PositionID) references Position(PositionID)
)

select *
from Player
--insert players data

drop table PlayerStats

create table PlayerStats(
PlayerStatsID int primary key,
PlayerID int not null,
SeasonID int not null,
Goals int,
Assists int,
ShotsOnGoal int,
BlockedShots int, 
TimeOnIce int,
constraint fkPlayerID foreign key (PlayerID) references Player(PlayerID),
constraint fkSeasonID1 foreign key (SeasonID) references Seasons(SeasonID)
)

select *
from PlayerStats
